import Footer from 'components/navigations/Footer'
import Navbar from 'components/navigations/Navbar'
import Layouts from 'hocs/layouts/Layouts'
import React, {useEffect} from 'react'

const request = async () => {
  const fetch =  fetch()
}

const Home = () => {
useEffect(() => {
  const res = fetch('http://127.0.0.1:8000/agencia/servicios/')
  
}, [])

  return (
    <Layouts>
        <Navbar/>
        <div className='pt-28'>
            {
              res.map((producto)=> (
                <h1>Hola</h1>
              ))
            }

        </div>
        <Footer/>
    </Layouts>
  )
}

export default Home
